  input: 'TEXT,F3XA,,"Dear Mr. Gibson:  This amended report is in reponse to your
    April 4, 2002 letter.  As you know, there is a discrepancy between the beginning
    cash balance of the 2001 Mid-Year Report (1/1/01-6/30/01) and the ending cash
    balance of the 2000 Year End Report (7/1/00-12/31/00).  This discrepancy is explained
    in the memo text for Line 6(a) on this Amended Report.   However, due to FEC concerns
    over this $2,105.55 difference, NATSO PAC conducted a thorough review of its financial
    records.  NATSO PAC was able to account for all of its transactions after January
    1, 1998.  Therefore, NATSO PAC believes that the unaccounted for receipts were
    received in the years 1996 & 1997.  NATSO PAC does not have complete financial
    records on receipts received prior to 1998.  NATSO PAC understands the need to
    disclose these receipts and will continue its attempt to locate these missing
    records Should any missing receipts be located, NATSO PAC willl immediately disclose
    them to the FEC."'
